static void updateMaxLine(const FindResult &ln)
{
	if(max_line_l < ~ln.line)
	{
		static SCROLLINFO si;
		si.cbSize = sizeof(si);

		max_line_l = ~ln.line;
		si.fMask = SIF_RANGE;
		si.nMin = 0;
		si.nMax = (i32)max_line_l;
		SetScrollInfo(main_wnd, SB_HORZ, &si, TRUE);
		InvalidateRect(main_wnd, NULL, FALSE);
	}
}

static void updateScrollState()
{
	SCROLLINFO si;
	si.cbSize = sizeof(si);

	updateMaxLine(result);

	si.fMask = SIF_RANGE/* | SIF_POS*/;
	si.nMin = 0;
	si.nMax = (i32)~results - 1;
	//si.nPos = si.nMax;
	
	SetScrollInfo(main_wnd, SB_VERT, &si, TRUE);

	if(~results < max_lines_num)
	{
		InvalidateRect(main_wnd, NULL, FALSE);
		UpdateWindow(main_wnd);
		//ScrollWindow(main_wnd, 0, (i32)cellh, NULL, NULL);
	}
}

static void findMaxLineAndUpdate()
{
	for(ui64 i = 0; i < ~results; ++i)
	{
		if(max_line_l < ~results[i].line)
		{
			max_line_l = ~results[i].line;
		}
	}
	
	SCROLLINFO si;
	si.cbSize = sizeof(si);
	si.fMask = SIF_RANGE;
	si.nMin = 0;
	si.nMax = (i32)max_line_l;
	SetScrollInfo(main_wnd, SB_HORZ, &si, TRUE);
	InvalidateRect(main_wnd, NULL, FALSE);
}

static void pushLine()
{
	results << result;

	if(main_wnd == NULL)
	{
		return;
	}

	updateScrollState();
}

