wtxt def_browser;

void setDefBrowser(wtxt &db)
{
	HKEY base_key = HKEY_CURRENT_USER;
	const wchar_t *sub_key = L"Software\\Clients\\StartMenuInternet";
	
retry:
	
	HKEY smenu_int = NULL;
	// Open Registry Key =================================================================================
	RegOpenKeyEx(
		HKEY_CURRENT_USER,			//   [I]  Handle to open reg key, or root key
		sub_key,					// [I|O]  Name of the registry subkey to be opened
		0, 							//   [I]  Options -> 0 || REG_OPTION_OPEN_LINK
		KEY_ENUMERATE_SUB_KEYS,		//   [I]  Security and Access Mask
		&smenu_int);				//   [O]  Ptr to variable that receives opened key handle
	// ===================================================================================================
	
	wtxt brow_key = 512;
	// Enumerate subkeys of a Registry Key ===============================================================
	RegEnumKeyEx(
		smenu_int,		//     [I]  Handle to open reg key, or root key
		0,				//     [I]	The index of the subkey to retrieve. Inc. each call. Not ordered
		brow_key,		//     [O]	Buffer that receives the name of the subkey. Including \0
		*brow_key,		//   [I|O]	I: Size of the buffer, including \0 O: Number of ch. written, no \0
		NULL,			//     [R]	Reserved and must be NULL
		NULL,			// [I|O|o]	Buffer that receives the user-defined class of the enumerated subkey
		NULL,			// [I|O|o]	Size of the buffer specified by the previous parameter
		NULL);			//	 [O|o]	A ptr. to FILETIME at which the enumerated subkey was last written
	// ===================================================================================================
	
	brow_key += WL("\\shell\\open\\command");
	
	HKEY def_brow_open = NULL;
	LSTATUS res = RegOpenKeyEx(
		smenu_int,
		brow_key,
		0,
		KEY_QUERY_VALUE,
		&def_brow_open);
	
	txt key_data = MAX_PATH * 2;
	
	// Get Registry Value ================================================================================
	res = RegGetValue(
		def_brow_open,		//     [I]  Handle to opened key (KEY_QUERY_VALUE  acc. req.)
		NULL,				//   [I|O]  Name of the registry subkey to be retrieved
		NULL,				//   [I|O]  Name of the value (if NULL or "" get def. value)
		RRF_RT_REG_SZ,		//   [I|O]  Flags comb. of data types to set filter (+ opt.)
		NULL,				//   [O|O]  Ptr to variable that recieves value type
		key_data,			//   [O|O]  Ptr to var that receive data of the value || NULL
		*key_data);			// [I|O|o]  Ptr sz. B -> N. of B cop. (NULL only pvData = NULL)
	// ===================================================================================================
	
	if(res != ERROR_SUCCESS)
	{
		if(base_key == HKEY_CURRENT_USER)
		{
			base_key = HKEY_LOCAL_MACHINE;
			RegCloseKey(smenu_int);
			RegCloseKey(def_brow_open);
			goto retry;
		}
		
		MessageBoxA(/*main_wnd*/NULL, "FAILED TO GET DEFAULT BROWSER! LINKS WON'T WORK!", "ERROR", MB_OK | MB_ICONSTOP);
	}
	
	txtMovToWtxt(key_data, db);
	
	RegCloseKey(smenu_int);
	RegCloseKey(def_brow_open);
}

