#define MAX_COMMENT_SNIPPET 70

wtxt fresult = 1024;
txt pattern_u8 = 1024;
wtxt attr_content_u16 = 16384;
txt comment_id = 16;
wtxt idx_txt = 16;
wtxt idx_padded = 16;

bool64 findInComment(ui64 com)
{
	// This. Must. Be. Destroyed. [<a href="#comment_859846" class="comment-parent-anchor">cherepets</a>, ]
	if(attr_content[0] == '<' && attr_content[1] == 'a')
	{
		ui64 lnk_ed = txtf(attr_content, 0, L("</a>")) + 4;
		
		if(txtfr(attr_content, 0, lnk_ed, L("comment-parent-anchor")) != NFND)
		{
			for(; lnk_ed < ~attr_content; ++lnk_ed)
			{
				if(attr_content[lnk_ed] != ',' && attr_content[lnk_ed] != ' ')
				{
					--lnk_ed;
					break;
				}
			}
			
			txtdp(attr_content, 0, lnk_ed);
		}
	}
	
	t2u16(attr_content_u16, attr_content); // This is very costly, I know... But I have no choice for now...
	ui64 shift = utfTxtFindCaseIns(attr_content_u16, 0, pattern);
	
	if(shift == NFND)
	{
		return false;
	}
	
	spacify(attr_content_u16);
	
	result.is_f = false;
	fresult += WL("COMMENT ");
	
	idx_txt = i2wt(com);
	idx_padded = WL("        "); // Million comments + one separating space
	for(ui64 j = 0; j < ~idx_txt; ++j)
	{
		idx_padded[j] = idx_txt[j];
	}
	
	fresult += idx_padded;
	result.idx = (ui16)~fresult;
	
	if(~attr_content_u16 > MAX_COMMENT_SNIPPET) // Cut out comment snippet
	{
		ui64 inc_chars = (MAX_COMMENT_SNIPPET - ~pattern); // Characters to include in snippet, not counting pattern
		ui64 pat_prefix = ~pattern >= MAX_COMMENT_SNIPPET ? 0 : inc_chars/2;
		ui64 pat_suffix = pat_prefix + inc_chars % 2;
		
		if(pat_prefix == 0)
		{
			fresult += '[', fresult += pattern, fresult += ']';
			result.p1 = 1;
			result.p2 = 1;
		}
		else
		{
			ui64 pat_to_end = ~attr_content_u16 - (shift + ~pattern); // Number of chars from pattern end to end of comment
			if(pat_to_end <= pat_suffix)
			{
				ui64 del_num = shift - pat_prefix - (pat_suffix - pat_to_end);
				txtd(attr_content_u16, 0, del_num);
				result.p1 = (ui16)(shift - del_num);
				result.p2 = (ui16)pat_to_end;
			}
			else if(shift <= pat_prefix)
			{
				txtd(attr_content_u16, shift + ~pattern + pat_suffix + (pat_prefix - shift), TEND);
				result.p1 = (ui16)shift;
				result.p2 = (ui16)(~attr_content_u16 - shift - ~pattern);
			}
			else
			{
				txtd(attr_content_u16, shift + ~pattern + pat_suffix, TEND);
				txtd(attr_content_u16, 0, shift - pat_prefix);
				result.p1 = (ui16)(pat_prefix);
				result.p2 = (ui16)(pat_suffix);
			}
			
			fresult += '[', fresult += attr_content_u16, fresult += ']';
			++result.p1, ++ result.p2; // ++ for []
			
			//attr_content_u16  [est11</a>, Для этого есть PS3 и XBOX360. А вообще игр довольно много.]
			//attr_content_u16  [<a href="#comment_2204" class="comment-parent-anchor">test11</a>, Для этого есть PS3 и XBOX360. А вообще игр довольно много.]
			//attr_content_u16  [est11</a>, Для этого есть PS3 и XBOX360. А вообще игр довольно много.]
			//attr_content_u16  [est11</a>, Для этого есть PS3 и XBOX]
			//attr_content_u16  [я этого есть PS3 и XBOX360. А вообще игр довольно много.]
			//attr_content_u16  [я этого есть PS3 и XBOX360. А вообще]
		}
	}
	else
	{
		fresult += attr_content_u16;
		result.p1 = (ui16)shift;
		result.p2 = (ui16)(~attr_content_u16 - shift - ~pattern);
	}
	
	result.line = fresult;
	
	txtclr(fresult);
	return true;
}

bool64 snipCommentIntoResult(const char *tag_name_ed, const char *txt_ed, ui64 com)
{
	const char *par = tag_name_ed; // Paragraph start
	while(++par != txt_ed)
	{
		if(*par == '<' && *(par+1) == 'p')
		{
			break;
		}
	}
	
	attrCont(par+2, L("</p>"));
	if(attr_content[0] == '<' && attr_content[1] == 'a')
	{
		ui64 lnk_ed = txtf(attr_content, 0, L("</a>")) + 4;
		
		if(txtfr(attr_content, 0, lnk_ed, L("comment-parent-anchor")) != NFND)
		{
			for(; lnk_ed < ~attr_content; ++lnk_ed)
			{
				if(attr_content[lnk_ed] != ',' && attr_content[lnk_ed] != ' ')
				{
					--lnk_ed;
					break;
				}
			}
			
			txtdp(attr_content, 0, lnk_ed);
		}
	}
	
	t2u16(attr_content_u16, attr_content);
	spacify(attr_content_u16);
	
	result.is_f = false;
	fresult += WL("COMMENT ");
	idx_txt = i2wt(com);
	idx_padded = WL("        ");
	for(ui64 j = 0; j < ~idx_txt; ++j)
	{
		idx_padded[j] = idx_txt[j];
	}
	fresult += idx_padded;
	
	if(~attr_content_u16 > MAX_COMMENT_SNIPPET)
	{
		fresult += '[';
		fresult += txtd(attr_content_u16, MAX_COMMENT_SNIPPET, TEND);
		fresult += ']';
		result.p2 = (ui16)(~attr_content_u16 + 2); // Never set [p1] here! It is set to UI64_MAX before this function!
	}
	else
	{
		fresult += attr_content_u16;
		result.p2 = (ui16)~attr_content_u16;
	}
	
	result.line = fresult;
	txtclr(fresult);
	return true;
}

txt sides_descript = 1024;
wtxt sides_descript_u16 = 1024;

FindResults war_results;
static wtxt wtitle = 1024;

cwstr site_base = WL(".\\comments\\");
wtxt file = MAX_PATH;

void find(ui64 war_index)
{
	file += i2wt(war_index), file += WL("\\index.html");
	filer fr = file;
	fr > file_buf > FC;

	const char *tb = (const char *)file_buf - 1;
	const char *te = (const char *)file_buf + ~file_buf - 3;

	while(++tb != te)
	{
		//<div class="select_side_a">дятлы рулят</div>
		//<div class="select_side_b">вейдеры рулят</div>
		
		if(memeq(tb, "<div", 4))
		{
			attrVal(tb+4, L("class"));
			if(attr_value == L("select_side_a"))
			{
				attrCont(tb+4, L("</div>"));
				sides_descript = attr_content, sides_descript += L(" VS ");
				tb += 4;
				continue;
			}
			if(attr_value == L("select_side_b"))
			{
				attrCont(tb+4, L("</div>"));
				sides_descript += attr_content;
				
				t2u16(sides_descript_u16, sides_descript);
				
				ui64 shift = txtfci(sides_descript_u16, 0, pattern);
				if(shift != NFND)
				{
					result.is_f = true;
					result.war = war_index;
					result.com = NFND;
					result.line = sides_descript_u16;
					war_results << result;
					
					++matches_found;
					if(main_wnd != NULL)
					{
						title = title_prefix + i2t(matches_found);
						SetWindowTextA(main_wnd, title);
					}
				}
				
				tb += 4;
				continue;
			}
			
			attrVal(tb+4, L("id"));
			
			if(txtf(attr_value, 0, L("comment_")) == NFND)
			{
				tb += 4;
				continue;
			}
			
			txts(comment_id, attr_value, 8, TEND);
			
			if(txtnui(comment_id))
			{
				tb += 4;
				continue;
			}
			
			const char *par = tb + 3; // Paragraph start
			while(++par != te)
			{
				if(*par == '<' && *(par+1) == 'p')
				{
					break;
				}
			}
			
			attrCont(par+2, L("</p>"));
			result.com = t2i(comment_id);
			if(!findInComment(result.com))
			{
				tb += 4;
				continue;
			}
			
			result.war = war_index;
			war_results << result;
			
			++matches_found;
			if(main_wnd != NULL)
			{
				title = title_prefix + i2t(matches_found);
				SetWindowTextA(main_wnd, title);
			}
		}
	}
	
	if(~war_results != 0)
	{
		result.is_f = true;
		result.war = war_index;
		result.com = NFND;
		
		result.line = WL("WAR ");
			
		idx_txt = i2wt(war_index);
		idx_padded = WL("      ");
		for(ui64 j = 0; j < ~idx_txt; ++j)
		{
			idx_padded[j] = idx_txt[j];
		}
		
		result.line += idx_padded;
		
		result.line += t2u16(wtitle, titles[war_index]);
		pushLine();
		
		for(ui64 i = 0; i < ~war_results; ++i)
		{
			result = war_results[i];
			pushLine();
		}
	}
	
	war_results.Clear();
	txtd(file, site_base.s, TEND);
}

static PAINTSTRUCT ps;
static SCROLLINFO si;
static FindResults &l = results;
static const wtxt one_tab_sps = WL("    ");
static wtxt tab_sp;

LRESULT wndProc(HWND wnd, UINT msg, WPARAM wp, LPARAM lp)
{
	switch(msg)
	{
	case WM_PAINT:
	{
		main_dc = BeginPaint(wnd, &ps); // BEGIN PAINT ------------------------------

		SelectObject(main_dc, default_font);

		if(ps.rcPaint.right == 0 && ps.rcPaint.bottom == 0)
		{
			EndPaint(wnd, &ps);
			return 0;
		}

		SetBkColor(main_dc, def_back);
		SetTextColor(main_dc, def_front);
		
		if(input_mode)
		{
			TextOutW(main_dc, (i32)cellw, (i32)cellh, pattern, (i32)~pattern);
			EndPaint(wnd, &ps);
			return 0;
		}

		si.cbSize = sizeof(SCROLLINFO);
		si.fMask = SIF_POS;
		GetScrollInfo(wnd, SB_VERT, &si); // Update vertical scroll position
		y_scrl = (ui64)si.nPos;
		GetScrollInfo(wnd, SB_HORZ, &si); // Update horizontal scroll position
		x_scrl = (ui64)si.nPos;

		ui64 vis_ln_beg = y_scrl + ps.rcPaint.top/cellh;
		ui64 vis_ln_end = y_scrl + ps.rcPaint.bottom/cellh;

		for(ui64 i = vis_ln_beg; i <= vis_ln_end && i < ~l; ++i)
		{
			i32 x = -((i32)x_scrl * (i32)cellw);
			i32 y = (i32)((i - y_scrl) * cellh);

			if(y < ps.rcPaint.top || y > ps.rcPaint.bottom)
			{
				continue;
			}
			
			if((i64)i == sel_line)
			{
				SetBkColor(main_dc, hov_back);
			}
			else
			{
				SetBkColor(main_dc, def_back);
			}

			if(l[i].is_f) // This line is a file path
			{
				SetTextColor(main_dc, file_path_c);
				TextOutW(main_dc, x, y, l[i].line, (i32)~l[i].line);
				SetTextColor(main_dc, def_front);
				continue;
			}
			
			const wchar_t *ln = (const wchar_t *)l[i].line;

			SetTextColor(main_dc, index_c);
			TextOutW(main_dc, x, y, ln, l[i].idx); // Paint index
			SetTextColor(main_dc, def_front);
			x += (i32)((l[i].idx) * cellw), ln += l[i].idx;
			
			if(l[i].p1 == UI16_MAX) // Disable all further beautification
			{
				TextOutW(main_dc, x, y, ln, l[i].p2); // Paint remaining line
				continue;
			}
			
			TextOutW(main_dc, x, y, ln, l[i].p1); // Paint 1st part of line
			SetTextColor(main_dc, pattern_c);
			x += (i32)((l[i].p1) * cellw), ln += l[i].p1;
			TextOutW(main_dc, x, y, ln, (i32)~pattern); // Paint pattern
			SetTextColor(main_dc, def_front);
			x += (i32)(~pattern * cellw), ln += ~pattern;
			TextOutW(main_dc, x, y, ln, l[i].p2); // Paint 2nd part of line
		}
		
		EndPaint(wnd, &ps); // END PAINT --------------------------------------------
	}	return 0;
	case WM_CREATE:
		mtrack.hwndTrack = wnd;
		return 0;
	case WM_SHOWWINDOW: // Window is about to be hidden or shown.
		updateScrollState();
		findMaxLineAndUpdate();
		return 0;
	case WM_SIZE:
		clw = LW(lp);
		clh = HW(lp);

		si.cbSize = sizeof(si);
		si.fMask = SIF_RANGE | SIF_PAGE;
		si.nMin = 0;
		si.nMax = (i32)~results - 1;
		si.nPage = (UINT)(clh/cellh);
		SetScrollInfo(wnd, SB_VERT, &si, TRUE);
		
		max_lines_num = si.nPage;

		si.nMax = (i32)max_line_l - 1;
		si.nPage = (UINT)(clw/cellw);
		SetScrollInfo(wnd, SB_HORZ, &si, TRUE);
	case WM_KEYUP:
		return wmKeyUpHandler(wnd, wp);
	case WM_CHAR:
		return wmCharHandler(wnd, wp);
	case WM_LBUTTONDOWN:
		return wmLbuttonDownHandler(wp);
	case WM_LBUTTONUP:
		return wmLbuttonUpHandler();
	case WM_MOUSEMOVE:
		return wmMouseMoveHandler(lp);
	case WM_MOUSELEAVE:
		return wmMouseLeaveHandler();
	case WM_MOUSEWHEEL:
		return wmMouseWheelHandler(wnd, wp);
	case WM_VSCROLL:
		return wmVscrollHandler(wnd, wp);
	case WM_HSCROLL:
		return wmHscrollHandler(wnd, wp);
	case WM_ENTERSIZEMOVE:
		return wmEnterSzMoveSnap();
	case WM_MOVING:
		return wmMovingSnap(lp);
	case WM_CLOSE:
		DestroyWindow(wnd);
		return 0;
	case WM_DESTROY:
		return wmDestoryHandler();
	default:
		return DefWindowProc(wnd, msg, wp, lp);
	}
}

