void findInTitles()
{
	swSet(0);
	const wchar_t *fl = (const wchar_t *)pattern + ~pattern - 1; // Address of last character in pattern
	for(ui64 i = 0; i < TOTAL_WARS; ++i)
	{
		if(titles[i].s == 0)
		{
			continue;
		}
		
		t2u16(wtitle, titles[i]);
		
		if(~pattern > ~wtitle)
		{
			continue;
		}
		
		ui64 shift = NFND;
		const wchar_t *fb = pattern;
		const wchar_t *tb = wtitle, *te = (const wchar_t *)wtitle + ~wtitle - ~pattern + 1;
		
		while(tb != te)
		{
			const wchar_t *tc = tb;
			while(*fb == utfCharToLow(*tc))
			{
				if(fb == fl)
				{
					shift = (ui64)(tb - (const wchar_t *)wtitle);
					break;
				}
				
				++fb, ++tc;
			}
			
			fb = pattern, ++tb;
		}
		
		if(shift == NFND)
		{
			continue;
		}
		
		result.war = i;
		result.com = NFND;
		result.is_f = false;
		fresult += WL("WAR ");
		
		idx_txt = i2wt(i);
		idx_padded = WL("      ");
		for(ui64 j = 0; j < ~idx_txt; ++j)
		{
			idx_padded[j] = idx_txt[j];
		}
		
		fresult += idx_padded;
		result.idx = (ui16)~fresult;
		
		result.p1 = (ui16)shift;
		
		result.p2 = (ui16)(~wtitle - shift - ~pattern);
		fresult += wtitle;
		
		result.line = fresult;
		
		pushLine();
		
		++matches_found;
		
		if(main_wnd != NULL)
		{
			title = title_prefix + i2t(matches_found);
			SetWindowTextA(main_wnd, title);
		}
		
		txtclr(fresult);
	}
	swStop(0);
	finishFind();
}

void findInComments()
{
	swSet(0);
	for(ui64 i = 0; i < TOTAL_WARS; ++i)
	{
		if(titles[i].s == 0)
		{
			continue;
		}
		
		find(i);
	}
	swStop(0);
	finishFind();
}

